import '../css/homepage.css'
import Image from "../Images/center.jpg";

export default function Homepage() {


    return (
        <>
            <div className='container-image'>
                <img src={Image} className='w-100 d-block'/>
                <p className='imageSubtext'> My name is </p>
                <h3 className='imageSubtext'> Luis Gonzalez </h3>



            </div>
        </>
    )

}
